import React, { useState, useCallback } from 'react'
import { BrowserRouter as Router, Link } from 'react-router-dom'

import dataNav from '../../data-nav'
import logo from '../../../../images/svg/logo.svg'
import styles from '../../nav.module.css'

export type Props = {
  onClick?: any,
  activeElement?: string
}

const MenuItems: React.FC<Props> = ({ onClick, activeElement }) => {
  // const [activeElement, setActiveElement] = useState('Profile')

  // const handleClick = useCallback((e: React.MouseEvent) => {
  //   const title: string = e.currentTarget.innerHTML
  //   setActiveElement(title)
  // }, [])

  return (
    <>
      <ul>
        <Router>
          <li>
            <Link to={'/'}>{<img src={logo} alt="logo" className={styles.menuLogo} />}</Link>
          </li>
          {dataNav.map((el) => (
            <li key={el.title} className={styles.menuItem}>
              <img
                src={el.icon}
                className={el.title === activeElement ? styles.iconActive : styles.iconItem}
                alt="icon"
              />
              <Link
                to={`//localhost:3000/${el.title}`}
                onClick={onClick}
                className={el.title === activeElement ? styles.titleActive : styles.titleItem}
              >
                {el.title}
              </Link>
            </li>
          ))}
        </Router>
      </ul>
    </>
  )
}

export default MenuItems
